import React from 'react';
import { Link } from 'react-router-dom';
import Moment from "moment";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { library } from '@fortawesome/fontawesome-svg-core';
import { faPlayCircle } from "@fortawesome/free-solid-svg-icons";
import "../../assets/css/common/videoCards.css";


library.add(faPlayCircle);

function VideoCardLarge(props) {
    const { video } = props;
    {console.log("match_object :" , video)}
    return (
        <div className="card mb-1 p-0">
            <Link to={{
                pathname: '/leftPanel',
                state: {
                    viewable_id: video.match_obj.series_id,
                    selectedType: 'videos',
                    tag_id: 27,
                    video_id: video.id,
                    video: video
                }
            }}>

                <div className="card-body p-2">
                    <div className='video-card-image-size-large'>
                        <img src={video.thumb}
                            alt="no Iamge" />

                        <div className='play-button'>
                            <FontAwesomeIcon color="white"
                                icon={"play-circle"}
                                size="6x"
                            />
                        </div>
                    </div>
                    <h4 className="cardsmall-col-heading-black">
                        {video.title}
                    </h4>
                </div>
            </Link>
        </div>
    );
}

export default VideoCardLarge;
